<template>
    <div
        class="profile-conteiner-img"
        :class="theme === 'light' ? [ 'cursor-pointer-light' ] : [ 'cursor-pointer-dark' ]"
        data-cursor="pointer"
        @click="clickOnImg"
        @dragover.prevent="dragOver"
        @drop.prevent="drop"
    >
        <transition name="profile-img">
            <img
                v-if="userData.profileImg"
                :src="userData.profileImg"
                alt="profile-img"
                class="profile-img-real"
                data-cursor="pointer"
            />
            <div v-else class="wrapper-img" data-cursor="pointer">
                <svg class="profile-conteiner-img-picture" width="200" height="240" viewBox="0 0 200 240" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <rect x="-253" y="-486" width="490" height="789" fill="url(#pattern0)"/>
                <defs>
                    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                        <use xlink:href="#image0_0_67" transform="scale(0.00204082 0.00126743)"/>
                    </pattern>
                    <image id="image0_0_67" width="490" height="789" xlink:href="data:image/png;base64,"/>
                </defs>
                </svg>
                <div class="profile-conteiner-img-blur"></div>
            </div>
        </transition>
    </div>
</template>

<script setup lang="ts">
    import useUserData from "../../../pinia/useUserData";
    import useNotifications from "../../../pinia/useNotifications";
    import useTheme from "../../../pinia/useTheme";
    import { storeToRefs } from "pinia";
    import axios from "axios";
    import type { CustomResponse } from "../../../data-types";

    const userDataStore = useUserData();
    const { userData } = storeToRefs(userDataStore);
    const { setUserData } = userDataStore;

    const notificationsStore = useNotifications();
    const { addNotification } = notificationsStore;

    const themeStore = useTheme();
    const { theme } = storeToRefs(themeStore);

    const sendImg = (imgFile: File) => {
        try {
            const { type, name } = imgFile;

            if ( !/(png|jpeg)$/.test(type) ) throw new Error("Wrong type of image");

            const reader = new FileReader();

            reader.readAsDataURL(imgFile);

            reader.addEventListener("load", async () => {
                const result = reader.result as string;

                const requestBody = { profileImg: result, name }

                const response = await axios.patch<CustomResponse<string>>("/add profile image", requestBody, {
                    headers: {
                        "Content-Type": "application/json",
                        "Accept": "application/json"
                    }
                });

                const { data } = response;
                const { status, message } = data;

                if ( status === "success" ) {
                    localStorage.setItem("profileImg", result)

                    setUserData({
                        profileImg: result
                    });

                    addNotification({
                        status: "success",
                        title: "Profile`s img was updated"
                    });
                } else {
                    throw new Error(message);
                }
            });

            reader.addEventListener("error", () => {
                throw new Error("Failed to load image, try again");
            });
        } catch (error) {
            const e = error as Error;

            console.log(e);

            addNotification({
                status: "fail",
                title: e.message
            });
        }
    }

    const clickOnImg = () => {
        const inputFileElement = document.createElement("input");

        inputFileElement.setAttribute("type", "file");

        inputFileElement.addEventListener("change", async (event) => {
            const inputElem = event.currentTarget as HTMLInputElement;

            const fileList = inputElem.files as FileList;

            const lastFile = Array.from(fileList).at(-1) as File;

            sendImg(lastFile);
        });

        inputFileElement.click();
    }

    const dragOver = (event: DragEvent) => {
        const dataTransfer = event.dataTransfer;

        if ( dataTransfer ) dataTransfer.dropEffect = "copy";
    }

    const drop = (event: DragEvent) => {
        const dataTransfer = event.dataTransfer;

        if ( dataTransfer ) {
            const files = dataTransfer.files;
            const lastFile = Array.from(files).at(-1) as File;

            sendImg(lastFile);
        };
    }
</script>

<style lang="scss">
    .profile-conteiner-img {
        position: relative;
        border-radius: 8px;
        height: 240px;
        width: 200px;
        cursor: pointer;

        .profile-img-real {
            height: 100%;
            max-height: 100%;
            width: 100%;
            max-width: 100%;
            object-fit: cover;
            object-position: center;
        }

        .profile-conteiner-img-picture {
            z-index: 1;
        }

        .profile-conteiner-img-blur {
            position: absolute;
            top: 0;
            left: 0;
            bottom: 0;
            right: 0;
            z-index: 2;
            background: rgba(255, 255, 255, 0.1);
            backdrop-filter: blur(6px);
        }
    }

    .profile-img-enter-active, .profile-img-leave-active {
        transition: all .35s;
    }

    .profile-img-enter-from, .profile-img-leave-to {
        opacity: 0;
        filter: blur(10px);
    }
</style>